        }

        public List<Rooms> Rooms
        {
            get
            {
                return GetInitialRoom();
            }
        }

        public void Create()
        {
            CreateRoomCategories();
        }

        private void AddRoomIfNotExists(Rooms room)
        {
            if (_context.Rooms.IgnoreQueryFilters().Any(l => l.Name == room.Name))
            {
                return;
            }

            _context.Rooms.Add(room);
            _context.SaveChanges();
        }

        private void CreateRoomCategories()
        {
            foreach (Rooms language in Rooms)
            {
                AddRoomIfNotExists(language);
            }
        }

